import React from "react";
import logo from "../../assets/img/logo.svg";
import "./App.css";

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="" alt="logo" />
        <p>Aparaadhi.</p>
      </header>
    </div>
  );
};

export default App;
